window.bookSummaryJSON = "<p>From <i>New York Times</i> best-selling author Aleatha Romig comes a brand-new dark romance trilogy bringing us back to the same dangerous underworld as WEB OF SIN. You do not need to listen to the Web of Sin trilogy to get caught in this new and intriguing saga, <i>Tangled Web</i>. </p> <p>With danger lurking around every corner and my life turned upside down, I struggle with who to believe and who to trust. </p> <p>Can my heart convince my mind that what was bound long ago is where I’ll find love, safety, and security? </p> <p>Or are the memories simply an illusion? </p> <p><i>BOUND</i> is Book Three, the final book of the TANGLED WEB trilogy that began with <i>TWISTED</i> and <i>OBSESSED</i>, and is concluding with <i>BOUND</i>. </p> <p>Have you been Aleatha’d?</p>"; 
